Échec du chargement des données de la carte, utilisation des données mises en cache localement, aucune carte valide trouvée, veuillez vérifier :
1. Si la connexion réseau est normale ;
2. Si l'alias de la carte est correctement configuré ;
3. S'il y a des points nécessaires pour la calibration de l'ascenseur ;
4. S'il existe des points et des routes valides dans la carte

Chargement des données de la carte réussi, aucune carte valide trouvée, veuillez vérifier :
1. Si l'alias de la carte est correctement configuré ;
2. S'il y a des points nécessaires pour la calibration de l'ascenseur ;
3. S'il existe des points et des routes valides dans la carte
